import React from "react";
import "../CSS/Aside.css";
const AsideLeft = () => {
  return (
    <aside className="Asideleft">
      <div className="AdSBox">
        <iframe src="https://www.blogwiki.in/" width="100%"></iframe>
      </div>
    </aside>
  );
};

export default AsideLeft;
